const Card = (props) => {
  return (
    <div className="black">
      <div>
        {props.children}
        <h2>Cars</h2>
        <img
          src="https://specials-images.forbesimg.com/imageserve/5d35eacaf1176b0008974b54/960x0.jpg?cropX1=790&cropX2=5350&cropY1=784&cropY2=3349.jpg"
          className="image"
        ></img>
        <p>Here is a picture of a car. Isn't it cool!</p>
      </div>
    </div>
  );
};

const StoryTag = () => (
  <div className="black">
    <div className="">
      <h1>Top Story</h1>
    </div>
  </div>
);

const StoryCardContent = () => (
  <div className="black">
    <div className="wrapper">
      <Card><h2>This Is Red</h2></Card>
      <Card></Card>
      <Card></Card>
    </div>
  </div>
);

const BodyContent = () => (
  <div className="black">
    <StoryTag />
    <StoryCardContent />
  </div>
);

export const Body = () => (
  <div className="center">
    <div className="cell inline">
      <BodyContent />
      <BodyContent />
      <BodyContent />
      <BodyContent />
    </div>
  </div>
);
